import React from 'react'
import { useState } from 'react';
import { useEffect } from 'react';

const Main = () => {
    const [message, setMessage] = useState('');

    useEffect(() => {
        fetch('/api')
            .then(response => response.json())
            .then(data => setMessage(data.message));
    }, []);

    return (
        <div className="App">
            <header className="App-header">
                <p>{message}</p>
            </header>
        </div>
    )
}

export default Main
